                total_water += 1
                if current_bucket < bucket_capacity:
                    current_bucket += 1
                else:
                    used_buckets += 1
                    current_bucket = 1
            elif current_bucket > 0:
                current_bucket = 0
        return current_bucket, used_buckets, total_water

    def fill_wells(grid, bucket_capacity):
        current_bucket = 0
        used_buckets = 0
        total_water = 0
